import { useMemo } from "react";
import "./App.css";
import { GetActivity } from "./hooks/GetActivity";

const App = () => {
  const { data, error, loaded } = GetActivity();

  if (loaded) {
    return error ? error : data;
  }
  return <span>Loading...</span>;
};

export default App;
